import LoginButton from '../components/LoginButton';
import LogoutButton from '../components/LogoutMenu';

const navigation = [
    { name: 'Product', href: '#' },
    { name: 'Features', href: '#' },
    { name: 'Marketplace', href: '#' },
    { name: 'Company', href: '#' },
  ]

export default function Navbar() {
  return(
    <header className="inset-x-0 top-0 z-50">
    <nav className="flex p-6 lg:px-8" aria-label="Global">
    < div className="flex-0">

      </div>
      <div className="flex-1 flex flex-row lg:gap-x-12 justify-center">
        {navigation.map((item) => (
          <img class="overflow-hidden w-10 h-10 rounded-full p-1 ring-2 ring-gray-500 dark:ring-gray-500" 
          src="logo.png"
        />
        ))}
      </div>
      <div className="flex-0">
          <LoginButton/>
          <LogoutButton/>
      </div>
      </nav>
  </header>
  )
}
